import * as React from "react";

import { useNavigate, Link  } from 'react-router-dom';

function VideoComponent({ src, className }) {
  return (
    <video autoPlay loop muted playsInline webkit-playsinline className={className}>
      <source src={src} type="video/mp4" />
      Your browser does not support the video tag.
    </video>
  );
}

function TextBlock({ children }) {
  return (
    <div className="mt-12 text-3xl text-white max-md:mt-6 max-md:max-w-full">
      {children}
    </div>
  );
}

function Trillionit() {

  const navigate = useNavigate();
  const isSignedIn = !!localStorage.getItem('accessToken');

  const handleLogout = () => {
    localStorage.removeItem('accessToken');
    navigate('/');
  };

  const handleLogin = () => {
    navigate('/login');
  };
  return (
    <>
    <div className="flex gap-5 justify-between items-center w-full max-md:flex-wrap max-md:pr-5 max-md:max-w-full">
    <div className="flex flex-col self-stretch text-4xl font-bold">
      <div className="flex gap-5">
      <header className="pl-6 mt-10 max-md:mt-6 text-transparent bg-clip-text bg-gradient-to-r from-purple-500 to-white">
      <Link to="/" className="text-4xl font-semibold leading-tight max-md:text-3xl">
              NEO TRILLI AO
            </Link>
      </header>

      </div>

    </div>

    <nav className="flex gap-5 justify-between self-stretch my-auto max-md:flex-wrap max-md:max-w-full">
    <Link to="/" className="my-auto text-2xl text-white">
             Home
            </Link>
      <a
        href="#"
        onClick={() => {
          window.scrollTo({
            top: document.body.scrollHeight,
            behavior: 'smooth'
          });
        }}
        className="justify-center px-7 py-5 text-2xl font-semibold text-fuchsia-700 whitespace-nowrap shadow bg-zinc-100 rounded-[50px] max-md:px-5"
      >
        Products
      </a>
      <Link to="/profile" className="my-auto text-2xl text-white">
            Profile
          </Link>
      <button
            onClick={isSignedIn ? handleLogout : handleLogin}
            className="my-auto text-2xl text-white"
          >
            {isSignedIn ? 'Log Out' : 'Log In'}
      </button>
      <div className="flex flex-col self-start"></div>
    </nav>
  </div>
    <div className="flex flex-col px-5 items-center">
      <header className="pl-6 mt-10 max-md:mt-6 text-transparent bg-clip-text bg-gradient-to-r from-purple-500 to-white">
        <h1 className="text-4xl font-semibold leading-tight max-md:text-3xl">
        TRILLI ON IT - MONEY WALLET
        </h1>
      </header>

      <main className="mt-12 max-md:mt-6 max-md:max-w-full">
        <section className="flex gap-6 max-md:flex-col max-md:gap-0">
        <VideoComponent src="https://trillion-funding-fqgv.onrender.com/uploads/wallet.mp4" alt="3D BLOKCHAIN - BIODIGITAL SUPREMACY" className="self-stretch w-full aspect-[1.16] max-md:max-w-full" />

          <TextBlock>

          <p className="mb-6">
            Trilli On It Money Wallet is not only the first Hybrid Money Wallet in the World, it is the only Hybrid Money Wallet in the World!! It can store all Digital Financial Assets including all Fiat Currencies, Translatable Stock Options Certificates, Translatable Shareholder Certificates, and all Crypto Currencies.
            </p>
            <p className="mb-6">
            Trilli On It Money Wallet also doubles as a Digital Bank Card for the coming TRILLI ON BANK, which will have no Bank Fees, only Digital Card Transaction Fees, as well as No Interest Business Loans for Indigenous Peoples, and Interest Free Housing Loans for Indigenous Peoples.
            </p>
            <p className="mb-6">
            Every time you use your Digital Bank Card to pay for Transactions, you get rewarded with TrilliOn Krypto Kurrency.
            </p>

          </TextBlock>
        </section>
        <TextBlock>



            <p className="mb-6">
            Again Trilli On It Money Wallet is yet another BIODIGICHEMWARE that possesses the Intrinsic Nature to traverse the 3D Cymatic Lattice BioDigital Architecture, which is the New Dawn Application of the now & future that is housed by the 3D PIRAMYD CYMATIC CELL SPINDLE TECHNOLOGY that is HYBRID CHAMELEON HARDWARE.
            </p>
            <p className="mb-6">
            These otherworldly Technologies give unprecedented Financial Privileges to Indigenous Communities WorldWide via both Unhackable Financial Asset Security & Unhackable Personal Data Protection.
            </p>

            <p>
            As the Brand indelibly speaks, "Trilli On It" which translates directly to 8 Billion People possessing, sharing & controlling Trillions of Dollars worth of Currency, as opposed 1% of the World's populations possessing, controlling & not sharing it. Money Wallet in the fullness of what a Digital Wallet should do both now & the Future.
            </p>
          </TextBlock>
      </main> 



    </div>
    <h1>For any inquiries email us at :  drhamza@trilliao.com</h1>
    </>
  );
}

export default Trillionit;
